import base64
import time

import execjs

js_base64 = ''


def get_js():
    return base64.b64decode(js_base64).decode()


def get_ua():
    node = execjs.get(execjs.runtime_names.Node)
    ctx = node.compile(get_js())
    ua = ctx.call('t')
    return ua


if __name__ == '__main__':
    s = time.time()
    print(get_ua())
    print(time.time() - s)
